$(function () {
    Share = {
        vkontakte: function (purl, ptitle, pimg, text) {
            url = 'http://vkontakte.ru/share.php?';
            url += 'url=' + encodeURIComponent(purl);
            url += '&title=' + encodeURIComponent(ptitle);
            url += '&description=' + encodeURIComponent(text);
            url += '&image=' + encodeURIComponent(pimg);
            url += '&noparse=true';
            console.log(url);
            Share.popup(url);
        },
        facebook: function (purl, ptitle, pimg, text) {
            url = 'http://www.facebook.com/sharer/sharer.php?s=100';
            url += '&p[title]=' + encodeURIComponent(ptitle);
            url += '&p[summary]=' + encodeURIComponent(text);
            url += '&p[url]=' + encodeURIComponent(purl);
            url += '&p[images][0]=' + encodeURIComponent(pimg);
            Share.popup(url);
            console.log(pimg);
        },
        twitter: function (purl, ptitle) {
            url = 'http://twitter.com/share?';
            url += 'text=' + encodeURIComponent(ptitle);
            url += '&url=' + encodeURIComponent(purl);
            url += '&counturl=' + encodeURIComponent(purl);
            Share.popup(url);
        },
        popup: function (url) {
            window.open(url, '', 'toolbar=0,status=0,width=626,height=436');
        }
    };

    var pageuri = window.location.href;

    function getCountTW() {
        $.ajax({
            url: 'http://urls.api.twitter.com/1/urls/count.json?url=' + pageuri + '&callback=?',
            dataType: 'jsonp',
            success: function (data, status, jqXHR) {
                if (data.count > 0) {
                    $('.l-count-tw').html(data.count);
                }
            }
        });

    }

    function getCountFB() {
        $.getJSON('http://api.facebook.com/restserver.php?method=links.getStats&callback=?&urls=' + escape(pageuri) + '&format=json', function (data) {
            if (data[0].share_count > 0) {
                $('.l-count-fb').html(data[0].share_count);
            }
        });
    }


    function getCountVK() {
        VK = {};
        VK.Share = {};

        VK.Share.count = function (index, count) {
            if (count > 0) {
                $('.l-count-vk').html(count);
            }
        };
        $.getJSON('http://vkontakte.ru/share.php?act=count&index=1&url=' + pageuri + '&format=json&callback=?');
    }


    getCountTW();
    // getCountFB();
    getCountVK();

});

