function refreshMenu(that) {        
    //Deactivate the prior active item  
    var active = $(".unit-menu li.active");
    var nameActive = active.find('p').text();
    var idActive = active.attr('id');
    active.empty();
    active.append('<a href="' + idActive + '">' + nameActive +'</a>');
    active.toggleClass("active", false);
    active.toggleClass("inactive", true);
    
    //Make the clicked item active
    var nameInactive = $(that).find('a').text();
    $(that).empty();
    $(that).append('<div class="plaque"><p>' + nameInactive + '</p></div>');
    $(that).toggleClass("inactive", false);
    $(that).toggleClass("active", true);   
    
    //Set the subtitle
    $('h3.subtitle').text(nameInactive);
}

