/************************CHANGE MENU TYPE****************************/

$('.menu-icon').click(function() {
    
    //close menu additionals
    var menu = $('.front menu');
    hideChildPanels(menu);
    
    //change icon
    if ($(this).hasClass('resources')) {
        switchToResources.call(this);
    }
    if ($(this).hasClass('people')) {        
        switchToPeople.call(this);
    }
    
});

function switchToResources() {
    $(this).removeClass('resources');
    $(this).css('background', 'url("/local/templates/new_menu/img/case_w.png")');
    $(this).text('');     
    $(this).css('margin-top', 'initial');
    $(this).addClass('active-resources');

    var people = $('.active-people');        
    $(people).removeClass('active-people');
    $(people).addClass('people');
    $('.people').css('background', 'url("/local/templates/new_menu/img/user_t.png")');

    $('.main-menu-resources').show();
    $('.main-menu-people').hide();
}

function switchToPeople() {    
    $(this).removeClass('people');
    $(this).css('background', 'url("/local/templates/new_menu/img/user_w.png")');
    $(this).text('');     
    $(this).css('margin-top', 'initial');
    $(this).addClass('active-people');
    $('.active-resources').removeClass('active-resources').addClass('resources');

    var resources = $('.active-resources');        
    $(resources).removeClass('active-resources');
    $(resources).addClass('resources');
    $('.resources').css('background', 'url("/local/templates/new_menu/img/case_t.png")');

    $('.main-menu-resources').hide();
    $('.main-menu-people').show();
}

