/*
 * blockId - is the id of the li item that is moused over
 * The blockId is used to find the additional menu panel
 */

function getSubmenu(blockId) {
    var submenu;
    $('.menu-column').each(function() {        
        if ($(this).attr('id') === blockId) {            
            submenu = this;
        }
    });
    return submenu;
}

function hideChildPanels(menu, curBlockId, hide) {      
    $(menu).find('a').each(function() {      
        var submenu;
        var blockId = $(this).attr('id');        
        if (blockId) {                  
            blockId !== curBlockId ? $(this).removeClass('active') : false;
            var submenu = getSubmenu(blockId);                        
            blockId === curBlockId ? false : hide ? $(submenu).hide() : $(submenu).animate({'width': 'hide'}, {duration: 150});                                           
            hideChildPanels(submenu);            
        }         
     });     
}

function isNextLevelOpen(menu) {
    var result = false;
    $(menu).find('a').each(function() {
        var blockId = $(this).attr('id');   
        if (blockId) {
            $(getSubmenu(blockId)).is(':visible') ? result = true : false;
        }
    });
    return result;
}

function showAdditionalPanel() {    
    var blockId = $(this).find('a').attr('id');    
    var menu = $(this).parent().parent();    
    var nextLevelOpen = isNextLevelOpen(menu);    
    hideChildPanels(menu, blockId, blockId ? true : false);    

    if (blockId) {  
        $(this).find('a').addClass('active');
        var submenu = getSubmenu(blockId);        
        nextLevelOpen ? $(submenu).show() : $(submenu).animate({'width': 'show'}, {duration: 250});   
        $(submenu).find('.narrow-menu').addClass('big');
    }      
}

function showParentPanels(panel) {
    var panelId = panel.attr('id');
    var parentA = $('#' + panelId);
    if (parentA.length) {        
        var parentAPanel = parentA.parents('.menu-column');
        parentAPanel.animate({'width': 'show'}, {duration: 250});
        showParentPanels(parentAPanel);
    }        
}

function hideParentPanels(panel) {    
    var panelId = panel.attr('id');
    var parentA = $('#' + panelId);
    if (parentA.length) {
        parentA.addClass('path');
        var parentAPanel = parentA.parents('.menu-column');
        if (parentAPanel) {
            parentAPanel.animate({'width': 'hide'}, {duration: 150});
            hideParentPanels(parentAPanel);
        }
    }        
}

