var newsBlock = function () {
    var that = this;
    if ($(window).width() > 551) {
        that.newsBlock = $('.news-block .swiper-container:not(.swiper-news-mobile)').swiper({
            slidesPerView: 'auto',
            scrollbar: '.swiper-scrollbar:not(.swiper-scrollbar-news-mobile)',
            scrollbarHide: true,
            onSlideChangeEnd: function (swiper) {

                if (that.newsBlock.isEnd) {
                    that.initAjaxNews();
                }
            },
        });
    } else {
        that.newsBlock = $('.swiper-news-mobile').swiper({
            slidesPerView: 'auto',
            scrollbar: '.swiper-scrollbar-news-mobile',
            scrollbarHide: true,
            onSlideChangeEnd: function (swiper) {

                if (that.newsBlock.isEnd) {
                    that.initAjaxNewsMob();
                }
            },
        });
    };




    that.initAjaxNews = function () {
        var smallNewsWidth = $('.small-news').width();
        var dateLastNews = $('.last-news-date').attr('rel');
        var data = "lastDate=" + dateLastNews;

        if(window.location.href.indexOf("sotrudnichestvo") > -1) {
            data = "lastDate=" + dateLastNews + "&category=cooperation";
        }

        $.ajax({
            type: "GET",
            data: data,
            url: "/local/components/dstu/news.index/component.php",
            dataType: "json",
            beforeSend: function () {},
            complete: function () {},
            success: function (data) {
                var id = 0;
                var output = "";
                output += "<div class = 'swiper-slide news-slide'>";
                while (id < 4) {
                    output += "<div class = 'news small-news' style = 'height:" + smallNewsWidth + "px; background-image: url(" + data[id].PICTURE + ")'>";
                    output += "<div class = 'news-title'>";
                    output += "<a href = '/news/" + data[id].URL_DETAIL + "' class = 'block-link'> </a>";
                    output += "<div class = 'container-bg'>";
                    output += "<div class = 'container'>";
                    output += "<a href = '/news/" + data[id].SECTION_CODE + "' class = 'tag'>";
                    output += data[id].SECTION_NAME;
                    output += "</a>";
                    output += "<div class='title'>";
                    output += data[id].NAME;
                    output += "</div>"
                    output += "<div class='desc'>";
                    output += data[id].PREVIEW_TEXT;
                    output += "</div>";
                    output += "<div class='date'>";
                    output += data[id].DATE;
                    output += "</div>";
                    output += "</div>";
                    output += "</div>";
                    output += "</div>";
                    output += "</div>";

                    id++;


                }
                output += "</div>";

                that.newsBlock.appendSlide([
                    output
                ]);


                if (typeof data[id] !== "undefined") {
                    var lastActiveItem = data[3].ACTIVE_FROM;
                    dateLastNews = $('.last-news-date').attr('rel', lastActiveItem);
                }

            }
        });
    }

    that.initAjaxNewsMob = function () {
        var bigNewsWidth = $('.big-news').width();
        var dateLastNews = $('.last-news-date').attr('rel');

        $.ajax({
            type: "GET",
            data: "lastDate=" + dateLastNews,
            url: "/local/components/dstu/news.index/component.php",
            dataType: "json",
            beforeSend: function () {},
            complete: function () {},
            success: function (data) {
                var id = 0;
                var output = "";
                output += "<div class = 'swiper-slide news-slide'>";
                while (id < 1) {
                    output += "<div class = 'news big-news' style = 'height:" + bigNewsWidth + "px; background-image: url(" + data[id].PICTURE + ")'>";
                    output += "<div class = 'news-title'>";
                    output += "<a href = '/news/" + data[id].URL_DETAIL + "' class = 'block-link'> </a>";
                    output += "<div class = 'container-bg'>";
                    output += "<div class = 'container'>";
                    output += "<a href = '/news/" + data[id].SECTION_CODE + "' class = 'tag'>";
                    output += data[id].SECTION_NAME;
                    output += "</a>";
                    output += "<div class='title'>";
                    output += data[id].NAME;
                    output += "</div>"
                    output += "<div class='desc'>";
                    output += data[id].PREVIEW_TEXT;
                    output += "</div>";
                    output += "<div class='date'>";
                    output += data[id].DATE;
                    output += "</div>";
                    output += "</div>";
                    output += "</div>";
                    output += "</div>";
                    output += "</div>";

                    id++;


                }
                output += "</div>";

                that.newsBlock.appendSlide([
                    output
                ]);

                if (typeof data[id] !== "undefined") {
                    var lastActiveItem = data[3].ACTIVE_FROM;
                    dateLastNews = $('.last-news-date').attr('rel', lastActiveItem);
                }

            }
        });
    }



    $(window).resize(function () {
        var bigNewsWidth = $('.big-news').width();
        $('.big-news').height(bigNewsWidth);
        var smallNewsWidth = $('.small-news').width();
        $('.small-news').height(smallNewsWidth);
        var mediumNewsWidth = $('.medium-news').width();
        $('.medium-news').height(mediumNewsWidth / 2);
    });
}


